import jsPDF from 'jspdf';
import 'jspdf-autotable'

export const pdfService = {
  createPDF,

};

function createPDF(tableReactionData, tableSummaryData, tableProcessData, responseTimeMean, reactionTimeMean, responseTimeMedian, reactionTimeMedian){

    const id = returnID();

    const cross = 'data:image/png;base64,';
    const green_tick = 'data:image/png;base64,';
    const ncl_logo = 'data:image/png;base64,';
    const logo = 'data:image/png;base64,';
    const doc = new jsPDF();

    doc.addImage(ncl_logo, 'PNG', 20, 20, 30, 12);
    doc.addImage(logo, 'PNG', 150, 20, 30, 12);
    doc.setFontSize(22);
    doc.text(20, 50, 'Assessment Report');
    doc.setFontSize(14);
    doc.text(20, 60, 'DAAWN v.1.0');
    doc.text(20, 80, 'Name');
    doc.text(20, 95, 'DOB');
    doc.text(20, 110, 'Clinician Name');
    doc.text(20, 125, 'Participant ID : ' + id);
    doc.text(20, 140, 'Notes');

    doc.addPage()

    doc.text(20, 20, 'Reaction data');

    console.log(tableReactionData);
    for(let index in tableReactionData){
        if(tableReactionData.hasOwnProperty(index)){
            if(tableReactionData[index][1] === 1){
               console.log()
               tableReactionData[index][1] = green_tick;
            }
            else {
                tableReactionData[index][1] = cross;
            }
        }
    }

    doc.autoTable({
      head: [['Item', 'Correct/Incorrect', 'End Response', 'CAT', 'LD', 'Reaction Time', 'Response Time']],
      body: tableReactionData
    });

    doc.addPage()

    doc.text(20, 20, 'Mean and median responses');

    doc.text(20, 40, 'Mean Reaction Time : ' + reactionTimeMean);
    doc.text(20, 50, 'Mean Response Time : ' + responseTimeMean);
    doc.text(20, 60, 'Median Reaction Time : ' + reactionTimeMedian);
    doc.text(20, 70, 'Median Response Time : ' + responseTimeMedian);

    doc.addPage()

    doc.text(20, 20, 'Summary data');

   // must correspond to set taken, so should not show 5+ letters if set 4 is taken.
    doc.autoTable({
      head: [['Breakdown', 'No. Items', 'No. Correct', 'Percentage Correct', 'Correct without cue'  ]],
      body: tableSummaryData
    });

    doc.addPage()

    doc.text(20, 20, 'Process response');

    const headrow = [['Item', 'Process Response', 'No. Letters', 'Keystrokes', 'No. Deletions']];

     doc.autoTable({
            head: headrow,
            body: tableProcessData,
            startY: 20
          });


    doc.save('report.pdf');


}

function returnID() {
  // Math.random should be unique because of its seeding algorithm.
  // Convert it to base 36 (numbers + letters), and grab the first 9 characters
  // after the decimal.
  return Math.random().toString(36).substr(2, 9);
};
